        __M_writer(u'"/></a>\n<h3>SarS. \u0424\u043e\u0440\u0442\u0435\u043f\u0438\u0430\u043d\u043e.</h3>\n<p>\u0410\u0440\u0442\u0435\u043c \u043c\u043e\u0436\u0435\u0442 \u043d\u0435 \u0442\u043e\u043b\u044c\u043a\u043e \u0432\u043e\u0442 \u0442\u0430\u043a\u043e\u0439 \u043a\u0440\u0430\u0441\u043e\u0442\u044b \u0444\u043e\u0442\u043e \u043f\u0440\u0438\u0441\u043b\u0430\u0442\u044c \u0432 \u043d\u0430\u0448\u0443 \u0432\u0438\u0440\u0442\u0443\u0430\u043b\u044c\u043d\u0443\u044e \u0441\u0442\u0443\u0434\u0438\u044e. \u041e\u043d \u0435\u0449\u0435 \u043d\u0430 \u0444\u043e\u0440\u0442\u0435\u043f\u0438\u0430\u043d\u043e \u0438\u0433\u0440\u0430\u0435\u0442.</p>\n<p>\u0427\u0435\u043c \u0438 \u0437\u0430\u0439\u043c\u0435\u0442\u0441\u044f \u0432 \u0441\u0443\u0431\u0431\u043e\u0442\u0443.</p>\n<p><em>\u041c\u0443\u0437\u044b\u043a\u0430. \u041b\u044e\u0431\u043b\u044e \u0441\u043b\u0443\u0448\u0430\u0442\u044c \u043c\u0443\u0437\u044b\u043a\u0443, \u043b\u044e\u0431\u043b\u044e \u0438\u0433\u0440\u0430\u0442\u044c \u043d\u0430 \u0444\u043e\u0440\u0442\u0435\u043f\u0438\u0430\u043d\u043e. \u041b\u044e\u0431\u043b\u044e \u0438\u0433\u0440\u0430\u0442\u044c \u043b\u044e\u0431\u0438\u043c\u043e\u0435 \u043f\u0440\u043e\u0438\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0435 \u0434\u043b\u044f \u043b\u044e\u0431\u0438\u043c\u043e\u0433\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430.</em></p>\n</div>\n\n<div class="news">\n<span class=\'date\'>25.11.2010 2:58:12</span>\n<a class="gall" style="clear:right;float:right" href="http://sergtk.com/sites/default/files/2010-11_Cold/bez_tulupa.JPG"><img style="height:160px;margin-left:0px;border-left:none" src="http://sergtk.com/sites/default/files/2010-11_Cold/bez_tulupa.JPG"/></a>\n<a class="gall" style="float:right" href="http://lh5.ggpht.com/_9dgQFA-IjyA/TDTn9ru2JTI/AAAAAAAAAGA/mKohEthc-YE/s512/IMG_0520.JPG"><img style="height:160px;margin-right:0px;border-right:none;padding-right:0px;" src="http://lh5.ggpht.com/_9dgQFA-IjyA/TDTn9ru2JTI/AAAAAAAAAGA/mKohEthc-YE/s512/IMG_0520.JPG"/></a>\n<h3>\u0421\u0435\u0440\u0433\u0435\u0439 \u0422\u043a\u0430\u0447\u0443\u043a. \u0414\u0440\u0443\u0436\u0431\u0430 \u0441 \u0445\u043e\u043b\u043e\u0434\u043e\u043c.</h3>\n<p>\u0412\u043e-\u043f\u0435\u0440\u0432\u044b\u0445, \u043e\u0442 \u0434\u0443\u0448\u0438 \u043f\u043e\u0437\u0434\u0440\u0430\u0432\u043b\u044f\u0435\u043c \u0421\u0435\u0440\u0435\u0436\u0443 \u0441 \u0434\u043d\u0435\u043c \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0443 \u043d\u0435\u0433\u043e \u0431\u044b\u043b \u0432\u0447\u0435\u0440\u0430, 24 \u043d\u043e\u044f\u0431\u0440\u044f. \u0412\u043e-\u0432\u0442\u043e\u0440\u044b\u0445, \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u0441\u0430\u043c\u044b\u043c\u0438 \u043b\u0443\u0447\u0448\u0438\u043c\u0438 \u0438 \u0438\u0441\u043a\u0440\u0435\u043d\u043d\u0438\u043c\u0438 \u043f\u043e\u0436\u0435\u043b\u0430\u043d\u0438\u044f\u043c\u0438 \u0448\u043b\u0435\u043c \u0435\u043c\u0443 \u0432\u0434\u043e\u0433\u043e\u043d\u043a\u0443 \u0441\u0435\u0439 \u0430\u043d\u043e\u043d\u0441.</p>\n<p>\u0412 \u0440\u0430\u043c\u043a\u0430\u0445 \u0431\u043b\u043e\u043a\u0430 \xab\u0414\u0435\u0442\u0438 \u043f\u0440\u0438\u0440\u043e\u0434\u044b\xbb \u044d\u0442\u043e\u0442, \u0432 \u043c\u0430\u043b\u043e \u043a\u0430\u043a\u0438\u0435 \u0440\u0430\u043c\u043a\u0438 \u0432\u043f\u0438\u0441\u044b\u0432\u0430\u044e\u0449\u0438\u0439\u0441\u044f, \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0440\u0430\u0441\u0441\u043a\u0430\u0436\u0435\u0442 \u043e \u0440\u0430\u0437\u043d\u043e\u043c. \u041e \u0442\u043e\u043c, \u043a\u0430\u043a \u043f\u0443\u0433\u0430\u043b \u0431\u0430\u0431\u0443\u0448\u0435\u043a, \u0433\u0443\u043b\u044f\u044f \u0432 \u043e\u0434\u043d\u043e\u0439 \u0444\u0443\u0442\u0431\u043e\u043b\u043a\u0435 \u043f\u0440\u0438 \u043c\u0438\u043d\u0443\u0441\u043e\u0432\u043e\u0439 \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u0435, \u043e \u0442\u043e\u043c, \u043a\u0430\u043a \u043e\u043d \u043a\u0430\u0436\u0434\u044b\u0439 \u0434\u0435\u043d\u044c \u043f\u0440\u0435\u0434\u0435\u043b\u044c\u043d\u043e \u043d\u0430\u0433\u0440\u0443\u0436\u0430\u0435\u0442 \u0442\u0435\u043b\u043e \u0438 \u0437\u0430\u043a\u0430\u043b\u044f\u0435\u0442 \u0434\u0443\u0445, \u0438 \u043e \u0442\u043e\u043c, \u043a\u0430\u043a\u0438\u0435 \u043f\u043b\u043e\u0434\u044b \u043f\u0440\u0438\u043d\u043e\u0441\u0438\u0442 \u044d\u0442\u0430 \u0440\u0430\u0431\u043e\u0442\u0430 \u043d\u0430\u0434 \u0441\u043e\u0431\u043e\u0439.</p>\n</div>\n\n<div class="news">\n<span class=\'date\'>24.11.2010 0:57:55</span>\n<a class="gall" style="clear:right;float:right" href="')
