        __M_writer(u'"/></a>\n<h3>\u0428\u043a\u043e\u043b\u0430 \u044d\u0442\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u043e\u0432 \xabGoDoPaTa\xbb</h3>\n<p>\u0411\u0430\u0440\u0430\u0431\u0430\u043d \u2014 \u043e\u0434\u0438\u043d \u0438\u0437 \u0441\u0430\u043c\u044b\u0445 \u0434\u0440\u0435\u0432\u043d\u0438\u0445 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u044b\u0445 \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u043e\u0432. \u0425\u043e\u0442\u044f \u043e\u0434\u043d\u043e\u0439 \u043c\u0443\u0437\u044b\u043a\u043e\u0439 \u0434\u0435\u043b\u043e \u043d\u0435 \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0438\u0432\u0430\u043b\u043e\u0441\u044c.\n\u0412 \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445 \u043f\u043b\u0435\u043c\u0435\u043d\u0430\u0445 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u044b \u0431\u044b\u043b\u0438 \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u043e\u043c \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u043a\u0430\u0446\u0438\u0438. \u0411\u0443\u0434\u0443\u0447\u0438 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0430\u043b\u044c\u043d\u044b\u043c \u044f\u0437\u044b\u043a\u043e\u043c, \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u043d\u044b\u0439 \u0440\u0438\u0442\u043c \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u044f\u043b \u043b\u044e\u0434\u0435\u0439, \u043f\u043e\u043c\u043e\u0433\u0430\u043b \u0438\u043c \u043f\u043e\u043d\u0438\u043c\u0430\u0442\u044c \u0434\u0440\u0443\u0433 \u0434\u0440\u0443\u0433\u0430 \u0431\u0435\u0437 \u0441\u043b\u043e\u0432, \u0441\u043e\u0437\u0434\u0430\u0432\u0430\u043b \u0446\u0435\u043b\u043e\u0441\u0442\u043d\u0443\u044e \u0441\u0442\u0440\u0443\u043a\u0442\u0443\u0440\u0443 \u043e\u0431\u0449\u0438\u043d\u044b.</p>\n<p>\u0412 \u043e\u0441\u043d\u043e\u0432\u0435 \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0445  \u0440\u0438\u0442\u043c\u043e\u0432 \u0438 \u043f\u0435\u0441\u0435\u043d \u2014 \u0436\u0438\u0432\u0430\u044f \u043f\u0440\u0438\u0440\u043e\u0434\u0430: \u0437\u0432\u0443\u043a\u0438 \u0436\u0438\u0432\u043e\u0442\u043d\u044b\u0445, \u043f\u0435\u043d\u0438\u0435 \u043f\u0442\u0438\u0446, \u0448\u0443\u043c \u0432\u0435\u0442\u0440\u0430. \u0421\u043e\u0437\u0434\u0430\u043d\u043d\u0430\u044f \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0446\u0430\u043c\u0438 \u043c\u0443\u0437\u044b\u043a\u0430 \u0432\u044b\u0436\u0438\u043b\u0430 \u0432\u043e\u043f\u0440\u0435\u043a\u0438 \u043a\u043e\u043b\u043e\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0438 \u0440\u0430\u0431\u0441\u0442\u0432\u0443.\n\u041d\u0438 \u0436\u0438\u0437\u043d\u0435\u043d\u043d\u0430\u044f \u044d\u043d\u0435\u0440\u0433\u0438\u044f, \u043d\u0438 \u0436\u0435\u043b\u0430\u043d\u0438\u0435 \u0442\u0430\u043d\u0446\u0435\u0432\u0430\u0442\u044c \u043f\u043e\u0434 \u0437\u0432\u0443\u043a\u0438 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u043e\u0432 \u043d\u0435 \u0438\u0441\u0442\u043e\u0449\u0438\u043b\u0438\u0441\u044c \u0437\u0430 \u0434\u043e\u043b\u0433\u0438\u0435 \u0433\u043e\u0434\u044b \u043d\u0430\u043c\u0435\u0440\u0435\u043d\u043d\u043e\u0433\u043e \u043f\u0440\u0438\u0442\u0435\u0441\u043d\u0435\u043d\u0438\u044f \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0439 \u043a\u0443\u043b\u044c\u0442\u0443\u0440\u044b. \u0410 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u044b \u0443\u0436\u0435 \u0434\u0430\u0432\u043d\u043e \u0441\u0442\u0430\u043b\u0438 \u043d\u0435\u043e\u0442\u044a\u0435\u043c\u043b\u0435\u043c\u043e\u0439 \u0435\u0435 \u0447\u0430\u0441\u0442\u044c\u044e.</p>\n<p>GoDoPaTa School \u0441\u0432\u043e\u0438\u043c \u0432\u044b\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435\u043c \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u0430\u0442 \u043e\u0449\u0443\u0449\u0435\u043d\u0438\u0435 \u0435\u0434\u0438\u043d\u0435\u043d\u0438\u044f \u0438 \u043e\u0431\u0449\u043d\u043e\u0441\u0442\u0438 \u043d\u0430 \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u043a\u043e\u043c \u0432\u0435\u0447\u0435\u0440\u0435.</p>\n</div>\n\n<div class="news">\n<span class=\'date\'>24.11.2010 0:53:49</span>\n<h3>\u0413\u0440\u0443\u043f\u043f\u0430 \xabCloud Jam\xbb</h3>\n<a class="gall" style="float:left" href="')
