        __M_writer(u'"/></a>\n<p style="margin-top:30px">\u0415\u043b\u0435\u043d\u0430 \xab<a href="http://vkontakte.ru/id15091432">\u042f\u0433\u0435\u043d</a>\xbb \u0428\u0430\u043c\u0440\u0438\u043d\u0430 (\u0444\u043b\u0435\u0439\u0442\u0430, \u0432\u043e\u043a\u0430\u043b, \u043c\u0443\u0437\u044b\u043a\u0430): <em>\u043f\u043e \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0438\u0438 \u2014 \u0445\u0443\u0434\u043e\u0436\u043d\u0438\u043a.\n\u0425\u0443\u0434\u043e\u0436\u043d\u0438\u043a \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u043e \u0432\u043e\u043b\u044c\u043d\u044b\u0439, \u0442\u0430\u043a \u043a\u0430\u043a \u043a\u0440\u043e\u043c\u0435 \u0440\u0430\u0437\u043d\u043e\u0433\u043e \u0440\u043e\u0434\u0430 \u0440\u0438\u0441\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0437\u0430\u043d\u0438\u043c\u0430\u044e\u0441\u044c \u0435\u0449\u0435 \u043c\u0443\u0437\u044b\u043a\u043e\u0439 \u0438 \u0442\u0435\u0430\u0442\u0440\u043e\u043c. \u041d\u0438\u0447\u0435\u0433\u043e \u043d\u0435 \u043c\u043e\u0433\u0443 \u043f\u043e\u0434\u0435\u043b\u0430\u0442\u044c \u0441\u043e \u0441\u0432\u043e\u0435\u0439 \u0440\u0430\u0437\u043d\u043e\u0441\u0442\u043e\u0440\u043e\u043d\u043d\u043e\u0441\u0442\u044c\u044e, \u043d\u043e \u0447\u0442\u043e-\u0442\u043e \u0438\u0437 \u044d\u0442\u043e\u0433\u043e \u0442\u0430\u043a\u0438 \u043f\u043e\u043b\u0443\u0447\u0430\u0435\u0442\u0441\u044f...)</em></p>\n<p style="clear:right">\u041a\u0430\u043b\u0430\u043c\u0435\u0435\u0446 \xab<a href="http://ha-ru-ki.livejournal.com/">\u0425\u0430\u0440\u0443\u043a\u0430</a>\xbb \u041d\u0430\u0434\u0435\u0436\u0434\u0430: <em>\u0433\u043b\u0430\u0432\u043d\u043e\u0435 \u0432 \u043c\u043e\u0435\u0439 \u0436\u0438\u0437\u043d\u0438 \u2014 \u0447\u0442\u043e\u0431\u044b \u043e\u043d\u0430 \u0431\u044b\u043b\u0430 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u043e\u0439 \u0438 \u043d\u0435\u043e\u0431\u044b\u0447\u043d\u043e\u0439.\n\u041b\u044e\u0431\u043b\u044e \u0432\u0441\u0451 \u0432\u043e\u043b\u0448\u0435\u0431\u043d\u043e\u0435 \u0438 \u043c\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0435. \u0416\u0438\u0437\u043d\u044c \u043f\u043e\u0441\u0432\u044f\u0449\u0430\u044e \u0442\u0432\u043e\u0440\u0447\u0435\u0441\u0442\u0432\u0443: \u0440\u0438\u0441\u0443\u044e \u043a\u0430\u0440\u0442\u0438\u043d\u044b, \u0437\u0430\u043d\u0438\u043c\u0430\u044e\u0441\u044c \u0442\u0435\u0430\u0442\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c\u044e, \u0438\u043d\u043e\u0433\u0434\u0430 \u0442\u0430\u043d\u0446\u0430\u043c\u0438, \u0438\u0433\u0440\u0430\u044e \u043d\u0430 \u0431\u0430\u0441-\u0433\u0438\u0442\u0430\u0440\u0435 \u0432 \u043a\u0430\u0432\u0435\u0440-\u0433\u0440\u0443\u043f\u043f\u0435, \u0430 \u0447\u0435\u0442\u044b\u0440\u0435 \u0433\u043e\u0434\u0430 \u043d\u0430\u0437\u0430\u0434 \u043d\u0430\u0447\u0430\u043b\u0430 \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u0430\u043c\u0438.\n\u041f\u0430\u0440\u0430\u043b\u043b\u0435\u043b\u044c\u043d\u043e \u0437\u0430\u043d\u0438\u043c\u0430\u044e\u0441\u044c \u0431\u043e\u0435\u0432\u044b\u043c\u0438 \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432\u0430\u043c\u0438, \u0438 \u0432\u043e\u043e\u0431\u0449\u0435 \u043f\u043e \u043c\u0438\u0440\u043e\u0432\u043e\u0437\u0437\u0440\u0435\u043d\u0438\u044e \u0447\u0430\u0441\u0442\u043e \u0441\u043c\u043e\u0442\u0440\u044e \u043d\u0430 \u0432\u043e\u0441\u0442\u043e\u043a.\n\u0421\u0435\u0439\u0447\u0430\u0441 \u0443\u0447\u0443\u0441\u044c \u043d\u0430 \u043f\u0441\u0438\u0445\u043e\u043b\u043e\u0433\u0430 \u0432 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0435 \u0438 \u0443\u0447\u0443 \u044f\u043f\u043e\u043d\u0441\u043a\u0438\u0439. \u0416\u0438\u0437\u043d\u044c \u043f\u0440\u0435\u043a\u0440\u0430\u0441\u043d\u0430!!!</em></p>\n</div>\n\n<div class="news">\n<span class=\'date\'>14.11.2010 2:56:02</span>\n<a class="gall" style="clear:right;float:right" href="')
