        __M_writer(u'"/></a>\n<h3>\u042e\u043b\u044f \u041d\u0435\u0441\u0442\u0435\u0440\u043e\u0432\u0430 \u0438 \u0435\u0435 \u0441\u0442\u0438\u0445\u0438</h3>\n<p>\n\u041b\u0435\u0442\u043e\u043c \u043c\u044b \u0441 \u0412\u043e\u043b\u043e\u0434\u0435\u0439 \u041f\u0438\u0440\u043e\u0436\u0435\u043d\u043a\u043e \u0443\u0447\u0430\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u0438 \u0432 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u0438\u0445 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0445 \u044d\u0442\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044f\u0445.\n\u041d\u0430 \u043e\u0434\u043d\u043e\u043c \u0438\u0437 \u043d\u0438\u0445 \u0447\u0438\u0442\u0430\u043b\u0430 \u0441\u0432\u043e\u0438 \u0437\u0430\u0432\u043e\u0440\u0430\u0436\u0438\u0432\u0430\u044e\u0449\u0438\u0435, \u0436\u0438\u0432\u043e\u043f\u0438\u0441\u043d\u044b\u0435 <a href="http://julianesterova.com.ua/virshi/znaky/djaz.html">\u0441\u0442\u0438\u0445\u0438</a> \u043d\u0435\u0441\u043c\u0435\u043b\u0430\u044f \u0438 \u043e\u0447\u0430\u0440\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0434\u0435\u0432\u043e\u0447\u043a\u0430, \u042e\u043b\u044f \u041d\u0435\u0441\u0442\u0435\u0440\u043e\u0432\u0430.\n\u0412\u044b\u0445\u043e\u0434\u044f \u043d\u0430 \u0441\u0446\u0435\u043d\u0443, \u0441\u043f\u043e\u0442\u044b\u043a\u0430\u043b\u0430\u0441\u044c, \u043a\u0430\u043a \u0438 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043e \u044e\u043d\u044b\u043c \u0434\u0430\u0440\u043e\u0432\u0430\u043d\u0438\u044f\u043c.\n</p>\n<p>\u0421\u043c\u043e\u0442\u0440\u0438\u0442\u0435, \u043f\u0440\u0435\u043b\u0435\u0441\u0442\u044c \u0432\u0435\u0434\u044c, \u0447\u0442\u043e \u0442\u0430\u043a\u043e\u0435:</p>\n<p><em>\u043c\u0435\u043d\u0435 \u0437\u0432\u0430\u0442\u0438 \u042e\u043b\u044f. \u0437 \u044f\u043a\u043e\u0457\u0441\u044c \u043d\u0435\u0432\u0456\u0434\u043e\u043c\u043e\u0457 \u043f\u0440\u0438\u0447\u0438\u043d\u0438 \u044f \u043f\u0438\u0448\u0443 \u0432\u0456\u0440\u0448\u0456, \u0456 \u0446\u0435 \u043c\u0435\u043d\u0456 \u043f\u043e\u0434\u043e\u0431\u0430\u0454\u0442\u044c\u0441\u044f.\n\u044f \u043c\u0440\u0456\u044e \u0441\u0442\u0430\u0442\u0438 \u043a\u0430\u0437\u043a\u0430\u0440\u0435\u043c, \u043a\u043e\u043b\u0438 \u0432\u0438\u0440\u043e\u0441\u0442\u0443 (\u043e\u0441\u043a\u0456\u043b\u044c\u043a\u0438 \u0437\u0430\u0440\u0430\u0437 \u043c\u0435\u043d\u0456 \u0432\u0441\u044c\u043e\u0433\u043e \u0434\u0435\u0432\'\u044f\u0442\u043d\u0430\u0434\u0446\u044f\u0442\u044c, \u0442\u043e \u0446\u0435 \u0449\u0435 \u0431\u0443\u0434\u0435 \u043d\u0435\u0441\u043a\u043e\u0440\u043e.\n\u0449\u043e\u043d\u0430\u0439\u043c\u0435\u043d\u0448\u0435 \u043d\u0435 \u0440\u0430\u043d\u0456\u0448\u0435 \u0434\u0432\u0430\u0434\u0446\u044f\u0442\u0438). \u0432\u0447\u0443\u0441\u044c \u043d\u0430 \u0434\u0440\u0430\u043c\u0430\u0442\u0443\u0440\u0433\u0430 \u0443 \u043d\u0430\u0439\u0431\u0456\u043b\u044c\u0448 \u0440\u043e\u0437\u0433\u0456\u043b\u044c\u0434\u044f\u0439\u043d\u0438\u0446\u044c\u043a\u043e\u043c\u0443 \u0443\u043d\u0456\u0432\u0435\u0440\u0456 \u041a\u0438\u0454\u0432\u0430.\n\u0456 \u0446\u0435 \u043c\u0435\u043d\u0456 \u0442\u0435\u0436 \u043f\u043e\u0434\u043e\u0431\u0430\u0454\u0442\u044c\u0441\u044f \u043d\u0430\u0434\u0437\u0432\u0438\u0447\u0430\u0439\u043d\u043e. \u043e\u0446\u0435, \u0432\u043b\u0430\u0441\u043d\u0435, \u0456 \u0432\u0441\u0435:)</em></p>\n<p>\u041d\u0430 \u041f\u0443\u0445\u0435 \u0432\u044b \u0441\u043c\u043e\u0436\u0435\u0442\u0435 \u0443\u0432\u0438\u0434\u0435\u0442\u044c \u044d\u0442\u043e \u0432\u0441\u0451 \u0441\u0432\u043e\u0438\u043c\u0438 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u043c\u0438 \u0433\u043b\u0430\u0437\u0430\u043c\u0438.</p>\n</div>\n\n<div class="news">\n<span class=\'date\'>13.11.2010 1:11:33</span>\n<a class="gall" style="clear:right;float:right" href="')
