        __M_writer(u'"/></a>\n<h3>\u0410\u043d\u043e\u043d\u0441: \u0414\u0438\u043c\u0430 \u0411\u0430\u0433\u0430\u0435\u0432 \u0438 \u0435\u0433\u043e \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u044f</h3>\n<p>\u041c\u044b \u0434\u043b\u044f \u0432\u0430\u0441 \u043f\u0440\u0438\u0433\u043e\u0442\u043e\u0432\u0438\u043b\u0438 \u0441\u044e\u0440\u043f\u0440\u0438\u0437: \u043d\u0435\u0444\u043e\u0440\u043c\u0430\u0442\u043d\u044b\u0439 \u0431\u043b\u043e\u043a \xab\u0414\u0435\u0442\u0438 \u043f\u0440\u0438\u0440\u043e\u0434\u044b\xbb!</p>\n<p>\u0418\u0437\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u043e \u043e\u043d \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b \u0432 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u0430\u0445 \u043f\u043e\u0434 \u043a\u043e\u0434\u043e\u0432\u044b\u043c \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435\u043c \xab\u0414\u0438\u043a\u0438\u0435 \u0447\u0443\u0432\u0430\u043a\u0438\xbb, \u043d\u043e \u043c\u044b \u0440\u0435\u0448\u0438\u043b\u0438, \u0447\u0442\u043e \u0432\u0441\u0435-\u0442\u0430\u043a\u0438 \u043d\u0435 \u043a\u043e\u043c\u0438\u043b\u044c\u0444\u043e.</p>\n<p>\u0411\u043b\u043e\u043a \xab\u0414\u0435\u0442\u0438 \u043f\u0440\u0438\u0440\u043e\u0434\u044b\xbb \u0441\u043e\u0441\u0442\u043e\u0438\u0442 \u0438\u0437 \u043d\u043e\u043c\u0435\u0440\u043e\u0432-\u043f\u043e\u0432\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0439 \u043e \u043b\u044e\u0434\u044f\u0445, \u0432\u0435\u0434\u0443\u0449\u0438\u0445 \u0437\u0434\u043e\u0440\u043e\u0432\u044b\u0439 \u0438 \u043a\u0440\u0430\u0441\u043e\u0447\u043d\u044b\u0439 \u043e\u0431\u0440\u0430\u0437 \u0436\u0438\u0437\u043d\u0438.</p>\n<p>\u0412 \u0440\u0430\u043c\u043a\u0430\u0445 \u044d\u0442\u043e\u0433\u043e \u0431\u043b\u043e\u043a\u0430 \u0432\u044b\u0441\u0442\u0443\u043f\u0438\u0442 \u0414\u0438\u043c\u0430 \u0411\u0430\u0433\u0430\u0435\u0432. \u0412 \u043f\u0440\u043e\u0448\u043b\u043e\u043c \u0433\u043e\u0434\u0443 \u0435\u0433\u043e \u0444\u043e\u0442\u043e \u0443\u043a\u0440\u0430\u0448\u0430\u043b\u0438 \u0441\u0442\u0435\u043d\u044b \u0437\u0430\u043b\u0430, \u0430 \u0441\u0430\u043c \u043e\u043d \u043d\u0435 \u0441\u043c\u043e\u0433 \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c, \u0442.\u043a. \u0431\u044b\u043b \u0432 \u043e\u0434\u043d\u043e\u043c \u0438\u0437 \u0441\u0432\u043e\u0438\u0445 \u043c\u043d\u043e\u0433\u043e\u0447\u0438\u0441\u043b\u0435\u043d\u043d\u044b\u0445 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0439.</p>\n<p>\u0418\u043c\u0435\u043d\u043d\u043e \u043e \u043d\u0438\u0445 \u0414\u0438\u043c\u0430 \u043d\u0430\u043c \u0440\u0430\u0441\u0441\u043a\u0430\u0436\u0435\u0442 \u0432 \u044d\u0442\u043e\u0442 \u0440\u0430\u0437, \u043f\u043e\u0434\u043a\u0440\u0435\u043f\u0438\u0432 \u0441\u043b\u043e\u0432\u0430 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f\u043c\u0438, \u0442\u043e \u0435\u0441\u0442\u044c \u043d\u043e\u0432\u044b\u043c\u0438 \u0444\u043e\u0442\u043e.</p>\n\n<p><em>\n\u041e\u0434\u043d\u0430\u0436\u0434\u044b \u0441\u043b\u0443\u0447\u0438\u043b\u043e\u0441\u044c \u0442\u0430\u043a, \u0447\u0442\u043e \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u0441\u0442\u0430\u043b\u043e \u043d\u0435 \u043f\u043e\u0435\u0437\u0434\u043a\u043e\u0439 \u0432 \u043e\u0442\u043f\u0443\u0441\u043a \u043d\u0430 \u043b\u0435\u0442\u043e, \u0430 \u0432\u0435\u0441\u043e\u043c\u044b\u043c \u043a\u0443\u0441\u043e\u0447\u043a\u043e\u043c \u0436\u0438\u0437\u043d\u0438.\n\u041a\u043e\u0433\u0434\u0430 \u043a\u0430\u043b\u0435\u0439\u0434\u043e\u0441\u043a\u043e\u043f \u043c\u0435\u0441\u0442 \u0438 \u044f\u0440\u043a\u0438\u0445 \u044d\u043a\u0437\u043e\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043a\u0430\u0440\u0442\u0438\u043d\u043e\u043a \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u043f\u0440\u0438\u0432\u044b\u0447\u0435\u043d, \u043d\u0435\u0432\u043e\u043b\u044c\u043d\u043e \u043e\u0431\u0440\u0430\u0449\u0430\u0435\u0448\u044c \u0441\u0432\u043e\u0439 \u0432\u0437\u043e\u0440 \u043d\u0430 \u043b\u044e\u0434\u0435\u0439 \u0438 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u043e\u0431\u044b\u0447\u043d\u043e\u0439 \u0436\u0438\u0437\u043d\u0438.\n\u0418 \u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442\u0441\u044f, \u0447\u0442\u043e \u0441\u0443\u0442\u044c \u0431\u044b\u0442\u0438\u044f \u043a\u0430\u043a \u0440\u0430\u0437 \u0432 \u044d\u0442\u043e\u043c \u0441\u0430\u043c\u043e\u043c \u043e\u0431\u044b\u0447\u043d\u043e\u043c.\n\u0418 \u0442\u0435\u043f\u0435\u0440\u044c \u0443\u0436\u0435 \u0435\u0434\u0435\u0448\u044c \u043d\u0435 \u0437\u0430 \u044f\u0440\u043a\u0438\u043c\u0438 \u0432\u043f\u0435\u0447\u0430\u0442\u043b\u0435\u043d\u0438\u044f\u043c\u0438 \u043e\u0442 \u0437\u0434\u0430\u043d\u0438\u0439, \u0430 \u0437\u0430 \u043b\u044e\u0434\u044c\u043c\u0438, \u0438\u0445 \u0436\u0438\u0437\u043d\u044c\u044e, \u044d\u043c\u043e\u0446\u0438\u044f\u043c\u0438, \u043f\u043e\u0432\u0441\u0435\u0434\u043d\u0435\u0432\u043d\u044b\u043c\u0438 \u0434\u0435\u043b\u0430\u043c\u0438, \u043c\u0435\u0447\u0442\u0430\u043c\u0438.\n\u041a\u043e\u043d\u0435\u0447\u043d\u043e, \u0434\u043e\u0441\u0442\u043e\u043f\u0440\u0438\u043c\u0435\u0447\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u043e\u0431\u043e\u0439\u0442\u0438 \u043d\u0435 \u0443\u0434\u0430\u0435\u0442\u0441\u044f, \u043d\u043e \u043e\u043d\u0438 \u043f\u0435\u0440\u0435\u0441\u0442\u0430\u044e\u0442 \u0431\u044b\u0442\u044c \u0446\u0435\u043b\u044c\u044e \u043f\u043e\u0435\u0437\u0434\u043a\u0438.\n\u0417\u0430\u0442\u043e \u0436\u0430\u0434\u043d\u043e \u0432\u043f\u0438\u0442\u044b\u0432\u0430\u0435\u0448\u044c \u0443\u043b\u044b\u0431\u043a\u0438, \u0432\u0437\u0433\u043b\u044f\u0434\u044b, \u0436\u0435\u0441\u0442\u044b, \u0437\u0432\u0443\u043a\u0438 \u0438 \u0437\u0430\u043f\u0430\u0445\u0438.\n</em></p>\n<p><em>\u042f \u043f\u043e\u043f\u044b\u0442\u0430\u044e\u0441\u044c \u0432 \u043a\u0430\u0440\u0442\u0438\u043d\u043a\u0430\u0445 \u043d\u0430 \u044d\u0442\u043e\u0439 \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0435 \u0432\u044b\u0440\u0430\u0437\u0438\u0442\u044c \u044d\u0442\u0443 \u0434\u0432\u043e\u0439\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u0431\u044b\u0442\u0438\u044f, \u043f\u0440\u043e\u0442\u0438\u0432\u043e\u0440\u0435\u0447\u0438\u0435 \u044d\u043a\u0437\u043e\u0442\u0438\u043a\u0438 \u0438 \u043e\u0431\u044b\u0434\u0435\u043d\u043d\u043e\u0441\u0442\u0438.</em></p>\n</div>\n\n<div class="news">\n<span class=\'date\'>11.11.2010 23:28:01</span>\n<a class="gall" style="clear:right;float:right" href="')
